import React, { Component } from 'react';
import { ForceGraph2D, ForceGraph3D, ForceGraphVR } from 'react-force-graph';
import { Button } from 'reactstrap';
export default class Try extends Component {
    constructor(props) {
        super(props);
        // Don't call this.setState() here!
        this.state = { 
            idCounter: 3,
            data: {
                nodes: [ 
                    { 
                      "id": "id1",
                      "name": "name1",
                      "val": 1 
                    },
                    { 
                      "id": "id2",
                      "name": "name2",
                      "val": 10 
                    },
                ],
                links: [
                    {
                        "source": "id1",
                        "target": "id2"
                    },
                ]
            }
        };
        this.handleAddNode = this.handleAddNode.bind(this);
    }
    handleAddNode(){
        this.setState(prevState => ({
            data: {
                nodes:[
                    ...prevState.data.nodes,
                    {
                        "id": "id" + prevState.idCounter,
                        "name": "name" + prevState.idCounter,
                        "val": 20

                    }                
                ],
                links: [
                    ...prevState.links
                ]
            },
            idCounter: prevState.idCounter++
        }))
    }
    render() {
        const data = this.state.data
      return(
          <div>
            <p>hallo</p>
            <Button onClick={this.handleAddNode}></Button>
            <ForceGraph2D graphData={data}></ForceGraph2D>

          </div>

      )
    }
  }
